con:config.script:
def serviceCount = context.findProperty( 'ServiceCount' );
def currentService = context.findProperty( 'Current Service ID' );
if (!currentService) currentService = "0";
currentServiceID = Integer.parseInt(currentService);
currentServiceID++;
def serviceInfo = context.findProperty( 'Service' + currentServiceID );
def serviceLocation = serviceInfo[0];
def serviceName = serviceInfo[2..serviceInfo.length()-1];
context.testCase.setPropertyValue('Service', serviceName);
context.testCase.setPropertyValue('Location', serviceLocation);
context.testCase.setPropertyValue('Current Service ID', currentServiceID.toString() );

con:configuration.scriptText:
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def holder = groovyUtils.getXmlHolder( messageExchange.responseContent )
holder.namespaces["ns1"] = "urn:gov:hhs:fha:nhinc:common:connectionmanagerinfo"
def location = context.findProperty('Location' );
def gatewayIP = context.findProperty( 'GatewayIP' );
def gatewayHostname = context.findProperty( 'GatewayHostName' );
def adapterIP = context.findProperty('AdapterIP' );
def adapterHostname = context.findProperty('AdapterHostName' );
if (location == "G") {
  IP = gatewayIP;
  hostname = gatewayHostname;
}
if (location == "A") {
  IP = adapterIP;
  hostname = adapterHostname;
} 

def url = holder["//ns1:ConnectionInfo[1]/ns1:serviceConnectionInfos[1]/ns1:serviceConnectionInfo[1]/ns1:url[1]"]
if (location != "O") assert (url =~ IP) || (url =~ hostname)

con:config.script:
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context );
def service = context.findProperty( 'Service' );
def serviceResponseHolder = groovyUtils.getXmlHolder( "GetConnectionInfoByServiceName#Response" );
def missingEntry = !(serviceResponseHolder.prettyXml =~ 'xsi:nil="true"');
if (missingEntry == false) service = service + " (missing)";
if (missingEntry == true) service = service + " (OK)";

log.info( "----------" );
log.info( service + ":");
log.info( "----------" );
log.info( serviceResponseHolder.prettyXml );

def serviceCount = context.findProperty( 'ServiceCount' );
def currentServiceID = context.findProperty( 'Current Service ID' );

if (currentServiceID != serviceCount) testRunner.gotoStepByName( "GetNextService" );

con:soapui-project.con:afterLoadScript:
def propertiesFile = new File(new File(project.path).parent, 'ValidateServices-soapui-project.properties')
if (propertiesFile.exists()) {
	def props = new Properties()
	props.load(new FileInputStream(propertiesFile))
	props.each { key, value ->
	    project.setPropertyValue(key, value)
	}
}

com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext.metaClass.findProperty = { propertyName ->
    return delegate.getProperty(propertyName) ?:
                delegate.testCase.getPropertyValue(propertyName) ?:
                delegate.testCase.testSuite.getPropertyValue(propertyName) ?:
                delegate.testCase.testSuite.project.getPropertyValue(propertyName)
}
